import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const App = () => {
  return (
    <>
      <h1 className="heading">The List of Top 5 Netflix Series</h1>


     { Sdata.map((val)=>{
        return (<Card
        imgscr={val.imgsrc}
        des={val.des}
        title={val.title}
        link={val.link}
      />)
      })}
      
      <Card
        imgscr="https://picsum.photos/250/300"
        des="A Original Netflix Series"
        title="Dark"
        link="https://www.google.com"
      />
      <Card
        imgscr="https://picsum.photos/250/300"
        des="A Original Netflix Series"
        title="Dark"
        link="https://www.google.com"
      />
    </>
  );
};

export default App;



